import React, { Component } from 'react';
import {Link } from 'react-router-dom';
import axios from 'axios';

const Enchere = props =>(

    <tr>
        <td>{props.enchere.etat}</td>
        <td>{props.enchere.categorie}</td>
        <td>{props.enchere.nom}</td>
        <td>{props.enchere.prix}</td>
        <td>{props.enchere.info}</td>
        <td>{props.enchere.contact}</td>
        <td>{props.enchere.img}</td>
        
    </tr>
)

export default class listEnchere extends Component {

    constructor(props){
        super(props);
        this.state={
            encheres:[]
        };
    }

    componentDidMount(){
        axios.get('http://localhost:4000/EbayDB/')
        .then(Response => {
            this.setState({encheres: Response.data});
        })
        .catch(function(error){

            console.log(error);
        })
        
    }
    enchereList() {
        return this.state.encheres.map(function(currentEnchere, i) {
            return <Enchere todo={currentEnchere} key={i} />;
        });
    }
  render() {
    return (
      <div>
        <h3>La liste des ench√®res</h3>
        <table className="table table-striped" style={{ marginTop: 20 }}>
                    <thead>
                        <tr>
                            <th>etat</th>
                            <th>categorie</th>
                            <th>nom</th>
                            <th>prix</th>
                            <th>info</th>
                            <th>contact</th>
                            <th>img</th>
                        </tr>
                    </thead>
                    <tbody>
                        { this.enchereList() }
                    </tbody>
                </table>
      </div>
    )
  }
}
